t = "Foi considerado 2007  pela IFFHS como o nono melhor clube europeu do século XX[4][5] e foi eleito pela FIFA o 12.º maior clube de futebol do século XX, sendo o primeiro entre os clubes portugueses.[6] O Benfica é o clube mais bem sucedido em Portugal (79 títulos), e um total de 81, incluindo as provas internacionais, sendo o único clube que ganhou todas as competições portuguesas. O Benfica ganhou 36 títulos da Primeira Liga,[7] 26 Taças de Portugal (4 das quais consecutivas) – com um recorde de 10 dobradinhas – 7 Taças da Liga (4 das quais consecutivas), 7 Supertaças Cândido de Oliveira e 3 Campeonatos de Portugal (com um recorde de 2 consecutivos).[8] Em 2014, o Benfica conquistou o inédito triplo (triplete) da Primeira Liga, Taça de Portugal e Taça da Liga.[9][10] Também ganhou a Supertaça, tornando-se o único clube a ganhar os quatro títulos domésticos num ano.[11][12] Além disso, é também o único clube que ganhou mais vezes a Primeira Liga e a Taça da Liga num único ano. O Benfica tornou-se a primeira equipa portuguesa na história dos campeonatos a completar 30 jogos sem perder, nomeadamente nas épocas 1972–73 e 1977–78. Também na época 72-73, o Benfica conseguiu a maior diferença de sempre de pontos do campeão para o segundo classificado (18), num sistema em que era atribuído 2 pontos por cada vitória.[13] O Benfica também tem o recorde europeu para o numero de vitórias consecutivas numa liga domestica (29), entre 1971–72 e 1972–73, assim como o recorde de maior numero de jogos sem derrotas (56), entre 1976–77 e 1978–79.[14][15] Segundo a BBDO, a marca Benfica ocupava, em 2007, a 17.ª posição das marcas de futebol mais valiosas da Europa"
